export default class Home extends React.Component {

    constructor(props) {
        super(props);
        this.state= {
            name: "",
            post: {},
            summoner_infos: [{},{}],
            summoner_id: '',
            summoner_account_id: '',
            status: 0,
            error_message: null,
            body: null,
            icon_url: '',
        };
    const APICall = "https://euw1.api.riotgames.com/lol/summoner/v4/summoners/by-name/" + players[0] + API_KEY;
    fetch(APICall).then((response) => {
        console.log(response);
        return response.json();

    }) .then((result) => {
        console.log('res', result)
        if (result.status) {
            this.setState({ status: result.status.status_code })
        } else {
            this.setState({status: 0})
        }
        this.setState({ summoner_id: result.id, summoner_account_id: result.accountId, post: result });
        //icon
        this.setState({ icon_url: 'http://ddragon.leagueoflegends.com/cdn/10.13.1/img/profileicon/' + result.profileIconId + '.png' })
        if (this.state.status === 0) {
            fetch('https://euw1.api.riotgames.com/lol/league/v4/entries/by-summoner/' + this.state.summoner_id + API_KEY)
                .then((response) => {
                    return response.json()
                })
                .then((result) => {
                    console.log('res is : ', result)
                    this.setState({ summoner_infos: result })

                })
        } else {
            console.log(this.state.status)
        }

    });

    }


    render() {

        const { name, summoner_infos, icon_url, error_message, body } = this.state;
    return (
        <Page title="Ranking">
                <Container>
                    <TableContainer component={Paper} >
        <aside>
       <Table sx={{ minWidth: 650 ,bgcolor: '#2F4F4F'}} aria-label="simple table">
        <TableHead>
          <TableRow >
            <TableCell sx={{ color: 'white'}}>Player</TableCell>
            <TableCell sx={{ color: 'white'}} align="right">Summoner Name</TableCell>
            <TableCell sx={{ color: 'white'}} align="right">Rank</TableCell>
            <TableCell sx={{ color: 'white'}} align="right">W</TableCell>
            <TableCell sx={{ color: 'white'}} align="right">L</TableCell>
            <TableCell sx={{ color: 'white'}} align="right">LP</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
            <TableRow
              sx={{ 'td, th': { border: 0, color: 'white' } }}
            >
              <TableCell component="th" scope="row">Alvyn</TableCell>

              <TableCell align="right">{players[0]}{}</TableCell>
              <TableCell align="right">{ summoner_infos[1] ? summoner_infos[1].tier : null } { summoner_infos[1] ? summoner_infos[1].rank : null }</TableCell>
              <TableCell align="right">{ (summoner_infos[1] && summoner_infos[1].leaguePoints) ? <p>{summoner_infos[1].leaguePoints } lp</p> : null }{(summoner_infos[1] && summoner_infos[1].wins) ? summoner_infos[1].wins : null}</TableCell>
              <TableCell align="right">{(summoner_infos[1] && summoner_infos[1].losses) ? summoner_infos[1].losses : null}</TableCell>   
              <TableCell align="right">{summoner_infos[1].leaguePoints}</TableCell>

            </TableRow>
            <Summoner></Summoner>   
            <Summoner2></Summoner2> 
            <Summoner3></Summoner3> 
            <Summoner4></Summoner4> 
        </TableBody>
      </Table>
      </aside>
    </TableContainer>

                </Container>
        </Page>
    )
}
}
